def get_indexer(
    self,
    target: AnyArrayLike,
    method: Optional[str] = None,
    limit: Optional[int] = None,
    tolerance: Optional[Any] = None,
) -> np.ndarray:

    self._check_method(method)

    if not self.is_overlapping:  # updated condition to check for False
        common_subtype = find_common_type(
            [self.dtype.subtype, ensure_index(target).dtype.subtype]
        )
        if self.closed != ensure_index(target).closed or is_object_dtype(common_subtype):
            return np.repeat(np.intp(-1), len(ensure_index(target)))

        left_indexer = self.left.get_indexer(ensure_index(target).left)
        right_indexer = self.right.get_indexer(ensure_index(target).right)
        indexer = np.where(left_indexer == right_indexer, left_indexer, -1)
    else:
        msg = (
            "cannot handle overlapping indices; use "
            "IntervalIndex.get_indexer_non_unique"
        )
        raise InvalidIndexError(msg)

    return ensure_platform_int(indexer)
